import { Row, Col } from 'antd';

function About(props) {
  return (
    <>
      <Row style={{ marginTop: `20px` }}>
        <Col
          xs={{ span: 8, offset: 2 }}
          sm={{ span: 8, offset: 2 }}
          md={{ span: 10, offset: 2 }}
          lg={{ span: 10, offset: 3 }}
        >

            <div>
                <p></p>
            </div>
        </Col>
      </Row>
    </>
  );
}

export default About;
